<!DOCTYPE html><html><head><meta charset='utf-8'><meta name='viewport' content='width=device-width, initial-scale=1'><title>Vista AI Chat</title><style>*{box-sizing:border-box;}:root{--arturo-primary:#f2c230;--arturo-ink:#141414;--arturo-muted:#4b4b4b;--arturo-bg:#f7f6f1;--arturo-panel:#ffffff;--arturo-border:#ded6c2;--arturo-focus:#1f1f1f;}body{font-family:'IBM Plex Sans','Segoe UI',system-ui,-apple-system,Roboto,Arial,sans-serif;margin:0;background:var(--arturo-bg);color:var(--arturo-ink);}button,input,select,textarea{font:inherit;}button{cursor:pointer;}.vista-button-icon{vertical-align:middle;margin-right:6px;height:1.2em;width:1.2em;display:inline-flex;align-items:center;justify-content:center;}.vista-button-icon img{height:100%;width:100%;display:block;}.vista-button-icon svg{height:100%;width:100%;display:block;}.vista-button-icon svg *{fill:currentColor !important;stroke:currentColor !important;}a{color:inherit;}.vista-app-header{position:sticky;top:0;z-index:1000;background:var(--arturo-primary);color:var(--arturo-ink);border-bottom:2px solid var(--arturo-ink);}.vista-app-header-inner{max-width:1100px;margin:0 auto;padding:10px 16px;display:flex;align-items:center;gap:12px;}.vista-app-logo{height:28px;width:auto;display:block;}.vista-app-mark{font-weight:700;font-size:15px;letter-spacing:0.5px;}.vista-app-title{font-weight:700;font-size:18px;}.vista-app-footer{position:relative;z-index:1000;background:var(--arturo-primary);color:var(--arturo-ink);border-top:1px solid var(--arturo-ink);padding:8px 16px;font-size:12px;opacity:0.85;}.vista-app-footer-inner{max-width:1100px;margin:0 auto;text-align:center;}.vista-app-author{font-weight:600;}.vista-app-date{opacity:0.8;}.vista-auth-header-controls{display:flex;align-items:center;gap:8px;margin-left:auto;}.vista-auth-header-btn{background:transparent;border:1px solid var(--arturo-ink);color:var(--arturo-ink);padding:4px 12px;border-radius:4px;cursor:pointer;font-size:13px;transition:all 0.2s ease;}.vista-auth-header-btn:hover{background:var(--arturo-ink);color:var(--arturo-primary);}.vista-auth-header-btn-primary{background:transparent;border:1px solid var(--arturo-ink);color:var(--arturo-ink);}.vista-auth-header-btn-primary:hover{background:var(--arturo-ink);color:var(--arturo-primary);opacity:1;}.vista-auth-header-user{font-size:13px;opacity:0.9;}.vista-auth-container{max-width:400px;margin:40px auto;}.vista-app-mark{font-weight:800;letter-spacing:0.2em;text-transform:uppercase;}.vista-app-title{font-size:18px;font-weight:700;}.vista-app-body{max-width:1100px;margin:0 auto;padding:16px;padding-bottom:60px;}.vista-row,.vista-layout-across{display:flex;gap:8px;align-items:center;flex-wrap:wrap;}.vista-col,.vista-layout-below{display:flex;flex-direction:column;gap:8px;}.vista-layout-row{display:flex;gap:8px;align-items:center;flex-wrap:wrap;}.vista-box{border:1px solid var(--arturo-border);background:var(--arturo-panel);border-radius:10px;padding:12px;}.vista-panel{border:1px solid var(--arturo-border);background:var(--arturo-panel);border-radius:12px;overflow:hidden;}.vista-panel-title{padding:8px 10px;font-weight:700;background:var(--arturo-primary);border-bottom:1px solid var(--arturo-ink);}.vista-panel-body{padding:12px;}.vista-details{border:1px solid var(--arturo-border);background:var(--arturo-panel);border-radius:10px;padding:8px 10px;}.vista-summary{cursor:pointer;font-weight:700;}.vista-details-body{padding-top:8px;}.vista-dialog{border:1px solid var(--arturo-border);border-radius:12px;background:var(--arturo-panel);padding:16px;max-width:min(92vw,560px);}.vista-grid{gap:8px;}.vista-spacer{min-height:8px;min-width:8px;}.vista-table{width:100%;border-collapse:collapse;background:var(--arturo-panel);}.vista-table th,.vista-table td{border:1px solid var(--arturo-border);padding:8px 10px;text-align:left;}.vista-table tbody tr:hover{background:#fbf0c2;}.vista-table tr.is-selected{background:#f7e199;}.vista-toolbar,.vista-menubar{display:flex;gap:6px;align-items:center;padding:6px 8px;background:var(--arturo-primary);border:1px solid var(--arturo-ink);border-radius:10px;}.vista-menubar{position:relative;}.vista-menu-panel{position:absolute;top:calc(100% + 4px);min-width:160px;background:var(--arturo-panel);border:1px solid var(--arturo-border);border-radius:8px;padding:6px;box-shadow:0 8px 20px rgba(0,0,0,0.12);display:none;z-index:1000;}.vista-menu-panel.is-open{display:block;}.vista-menu-item{display:block;width:100%;text-align:left;}.vista-tool-group{display:flex;gap:6px;align-items:center;}.vista-divider{border:none;border-top:1px solid var(--arturo-border);margin:8px 0;}.vista-canvas{border:1px solid var(--arturo-border);border-radius:8px;}.vista-split{display:flex;gap:8px;}.vista-split-pane{flex:1;}.vista-text-list{padding-left:18px;margin:0;}.vista-list{list-style:none;padding:0;margin:0;border:1px solid var(--arturo-border);border-radius:10px;background:var(--arturo-panel);max-height:220px;overflow:auto;}.vista-list li{padding:6px 8px;border-bottom:1px solid var(--arturo-border);cursor:pointer;}.vista-list li:last-child{border-bottom:none;}.vista-list li.is-selected{background:#0b5fff;color:#ffffff;font-weight:700;box-shadow:inset 0 0 0 2px #0a2f9a;}.vista-list li.is-active{outline:2px solid #8fb5ff;outline-offset:-2px;}ul[data-list-bind='selected_mission'] li::after{display:block;font-size:11px;opacity:0.9;margin-top:2px;font-weight:500;}ul[data-list-bind='selected_mission'] li[data-value='Mission 1']::after{content:'The Awakening of Awareness';}ul[data-list-bind='selected_mission'] li[data-value='Mission 2']::after{content:'The Hall of Pretexts';}ul[data-list-bind='selected_mission'] li[data-value='Mission 3']::after{content:'The Workshop of Human Factors';}ul[data-list-bind='selected_mission'] li[data-value='Mission 4']::after{content:'The Hall of Syndicates';}ul[data-list-bind='selected_mission'] li[data-value='Mission 5']::after{content:'The Labyrinth of Channels';}ul[data-list-bind='selected_mission'] li[data-value='Mission 6']::after{content:'The Vault of Credentials';}ul[data-list-bind='selected_mission'] li[data-value='Mission 7']::after{content:'The Citadel of Teams';}ul[data-list-bind='selected_mission'] li[data-value='Mission 8']::after{content:'The Theater of Adversaries';}ul[data-list-bind='selected_mission'] li[data-value='Mission 9']::after{content:'The Mirror of the Self';}ul[data-list-bind='selected_mission'] li[data-value='Mission 10']::after{content:'The Constellation of Defenders';}.vista-tabs{display:flex;flex-direction:column;gap:6px;}.vista-tabs-header{display:flex;gap:6px;flex-wrap:wrap;}.vista-tab-btn{padding:6px 10px;border:1px solid var(--arturo-border);border-radius:8px;background:var(--arturo-panel);}.vista-tab-btn.is-active{background:var(--arturo-primary);border-color:var(--arturo-ink);}.vista-tab-panel{display:none;padding:10px;border:1px solid var(--arturo-border);border-radius:10px;background:var(--arturo-panel);}.vista-tab-panel.is-active{display:block;}.vista-key{min-width:120px;}.vista-radio-group{display:flex;flex-direction:column;gap:6px;}.vista-radio-item{display:flex;align-items:center;gap:6px;}.vista-auth-splash{min-height:60vh;display:flex;align-items:center;justify-content:center;padding:24px;}.vista-auth-splash-card{max-width:680px;width:100%;text-align:center;padding:28px;border:2px solid var(--arturo-ink);border-radius:16px;background:var(--arturo-primary);box-shadow:0 24px 60px rgba(2,6,23,0.35);}.vista-auth-splash-logo{width:96px;height:96px;object-fit:contain;margin:0 auto 10px;display:block;}.vista-auth-title{font-size:34px;font-weight:800;margin:0;color:var(--arturo-ink) !important;background:transparent !important;padding:0;display:block;}.vista-auth-subtitle{color:var(--arturo-muted);margin:0;}.vista-auth-card{max-width:520px;margin:0 auto;}.vista-auth-meta{display:block;color:var(--arturo-muted);margin-bottom:6px;}html{-webkit-text-size-adjust:100%;}img,video,canvas{max-width:100%;height:auto;}textarea{max-width:100%;}@media (max-width:900px){.vista-app-header-inner,.vista-app-body{padding-left:12px;padding-right:12px;}.vista-app-title{font-size:16px;}.vista-split{flex-direction:column;}.vista-split-pane{flex-basis:auto !important;}.vista-grid{grid-template-columns:1fr !important;}.vista-row,.vista-layout-across,.vista-layout-row{flex-direction:column;align-items:stretch;}.vista-toolbar,.vista-menubar,.vista-tool-group{flex-wrap:wrap;}.vista-panel-body,.vista-box{padding:10px;}.vista-auth-splash{padding:14px;}.vista-auth-splash-card{padding:16px;}}@media (max-width:640px){.vista-app-header-inner,.vista-app-body{padding-left:10px;padding-right:10px;}.vista-app-logo{height:22px;}.vista-app-title{font-size:15px;}.vista-table{display:block;overflow-x:auto;-webkit-overflow-scrolling:touch;}.vista-tab-btn{width:100%;text-align:left;}}@media (pointer:coarse){button,input,select,textarea{min-height:40px;}}.vista-auth-card{max-width:760px !important;width:100%;}.vista-auth-card .vista-panel-body .vista-row{gap:14px;align-items:center;margin-bottom:12px;}.vista-auth-card .vista-panel-body input[type='text'],.vista-auth-card .vista-panel-body input[type='password'],.vista-auth-card .vista-panel-body input[type='email'],.vista-auth-card .vista-panel-body textarea,.vista-auth-card .vista-panel-body select{min-width:420px;width:100%;}.vista-auth-card .vista-panel-body button{margin-top:6px;}.vista-auth-card .vista-col{gap:12px;}:root{--arturo-primary:#6aa3e9;--arturo-bg:#f5f4f2;--arturo-ink:#1f1f1f;}.vista-app-title{color:#1f1f1f;}</style></head><body><header class='vista-app-header'><div class='vista-app-header-inner'><img class='vista-app-logo' src='data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAuwAAAJ7CAYAAAC4Q8QHAAAACXBIWXMAAA7DAAAOwwHHb6hkAAAQAElEQVR4Aey9B6AdVbU+/q21Z+a021t6JSQhCR0UBBRQUUHAFnvvXZ8++3saey8PFR+KYgMVFJUuvfcACZ30cpPc3k+Zmb3Wf81F39+fr6jvWQjOnDMzu67y7T2zvr3PJTDyI0cgRyBHIEcgRyBHIEcgRyBHIEfgMYtATtgfs0OTG5YjsLchkNubI5AjkCOQI5AjkCPw10AgJ+x/DVRzmTkCOQI5AjkCOQI5Av97BPKeOQI5Av8PAjlh/3/gyDM5AjkCO
